window.bookSummaryJSON = "<p>Everyone has secrets, and Rachel Holloway is no exception. She’s worked hard to keep the past where it belongs: dead and buried. And so far, she’s been very successful. But now the small newspaper where she works wants to produce a podcast on a cold case: the disappearance 12 years ago of young Molly Forster. </p> <p>Some secrets should never see the light of day, and, as far as Rachel is concerned, whatever happened to little Molly is one of them. Rachel has a life now - a boyfriend she loves and a three-year-old daughter she adores - and she will do anything to protect them. But to do that, no one can ever know that she is Molly Forster.</p>"; 
